// src/pages/Contact.js
import React from 'react';

const Contact = () => {
  return (
    <div className="contact">
      <h1>Contact Us</h1>
      <p>For inquiries and reservations, please contact us at info@dharma.com or call us at (123) 456-7890.</p>
    </div>
  );
};

export default Contact;
